function Card(props) {
  const handleClick = (e) => {
    e.preventDefault();
    console.log("${props.title} was clicked");
  };

  return (
    <div className="itemContainer cardTitle cardHidden" onClick={handleClick}>
      <h1>{props.title}</h1>
    </div>
  );
}

export default Card;
